import React from 'react';
import API from '../services/api';

export default function TicketList({ tickets, onChange }) {
  const cancel = async (id) => {
    if (!window.confirm('Cancel this booking?')) return;
    try { await API.delete(`/tickets/${id}`); alert('Cancelled'); if (onChange) onChange(); }
    catch (err) { console.error(err); alert('Cancel failed'); }
  };
  if (!tickets.length) return <p>No participants yet.</p>;
  return (
    <ul className="participants">
      {tickets.map(t=>(
        <li key={t._id}>
          <div><strong>{t.name}</strong> — {t.email} — Seats: {t.seats} — #{t.ticketNumber}</div>
          <div><button className="btn small danger" onClick={()=>cancel(t._id)}>Cancel</button></div>
        </li>
      ))}
    </ul>
  );
}
